import React from 'react'
import { useGlobalContext } from './context';
import Restaurant from './Restaurant'
import Map from './Map'


function Main() { 
    const { location, venues} = useGlobalContext();
  
    return (
        <div>
            <Map
                center={location}
                markers={venues}
            />
           
            <Restaurant venues={venues}/>
    </div>
    )
}

export default Main
